COPY batches (id, name, submitter_name, submitter_email, submitter_affiliation, reason_for_inclusion, file, url_slug, created_at, updated_at, reference_sequence_version, tags, reference_url) FROM stdin;
1	My Cancer Genome	Ben Ainscough	bainscou@genome.wustl.edu	McDonnell Genome Institute, Washington University School of Medicine	My Cancer Genome outlines variants that drive tumorigenesis and that have therapeutic implications. Upon review of the publications that My Cancer Genome cites, the majority of variants appear to be pathogenic. Few variants are diagnostic or prognostic, however My Cancer Genome does an excellent job outlining relevant clinical trials to variants.The variants outlined in My Cancer Genome are believable and well supported with a useful write up outlining each variants role in a particular cancer type. Links to these pages were included in DoCM to allow for access to these summaries for additional information about these variants. The transcript was chosen by the amino acid change most commonly resembled the variant outlined in the paper. In the event that there were multiple transcripts that included this variant, the longest transcript was chosen.	mcg.tsv	65996f1e-2e6b-461e-ab62-53158b6867c2-my-cancer-genome-ben	2016-05-17 18:57:07.058515	2016-05-17 18:57:07.058515	\N	Pathogenic	https://www.mycancergenome.org/about/what-is-my-cancer-genome/
2	WashU hematologic malignancy mutation list	Ben Ainscough	bainscou@genome.wustl.edu	McDonnell Genome Institute, Washington University School of Medicine	The WashU hematologic malignancy mutation list represents variants outlined for their importance in leukemias by investigators at Washington University that study hematologic malignancies. Many of these variants have established effects on tumor growth in leukemias with some having clinical trials performed. The transcript was chosen such that the amino acid change resembles the variant outlined in the cited paper. In the event that there were multiple transcripts that included this variant, the longest transcript was chosen.	tl.tsv	8f96d641-ba3e-47d7-ab19-6af419256240-washu-hematologic-malignancy	2016-05-17 20:28:27.017364	2016-05-17 20:28:27.017364	\N	Likely Pathogenic	
3	Literature	Ben Ainscough	bainscou@genome.wustl.edu	McDonnell Genome Institute, Washington University School of Medicine	This is a list of variants curated from the literature in the original release of DoCM.	literature.tsv	ebb72915-be4d-466c-bcda-fb3b871dd83f-literature-ben-ainscough	2016-05-17 20:37:34.539646	2016-05-17 20:37:34.539646	\N		
4	Drug Gene Knowledge Database	Jason Kunisaki, Ben Ainscough	bainscou@genome.wustl.edu	McDonnell Genome Institute, Washington University School of Medicine	The Drug Gene Knowledge Database by Dienstmann et al. [Cancer Discov; 5(2); 118-23] is an open resource that outlines the “prevalence of mutations and copy-number alterations with predictive associations across solid tumors.” This resource outlines the importance of individual variants in cancer along with a PubMed reference including the drugs that target a particular mutation. Only variants with a PubMed reference were included in DoCM. Since this database is open, high quality and freely available, useful metadata, like drug sensitivity information, was included in DoCM. The transcript was chosen such that the amino acid change resembles the variant outlined in the paper. In the event that there were multiple transcripts that included this variant, the longest transcript was chosen.	dienstmann.tsv	4f638893-76d4-41a2-855c-8c7f426afe1b-drug-gene-knowledge-database	2016-05-17 21:09:19.319876	2016-05-17 21:09:19.319876	\N	Likely Pathogenic	http://cancerdiscovery.aacrjournals.org/content/5/2/118.full.pdf
5	Oncomap Variants	Mayank Choudhary, Ben Ainscough	bainscou@genome.wustl.edu	McDonnell Genome Institute, Washington University School of Medicine	Oncomap is a listing of 471 variants with known and established importance in cancer, many of which are known to predict response or resistance to targeted therapies. The panel is used as a diagnostic test to identify tumorigenic mutations in clinical cases by MacConnaill et al. in their manuscript in the Journal of Molecular Diagnostics. Many of these mutations overlap with mutations already existing in DoCM and this panel adds further credibility to their importance. As only the gene and amino acid were listed in the publication, many fields were filled in by manual curation. The transcript was chosen such that the amino acid change resembles the variant outlined in the cited paper. In the event that there were multiple transcripts that included this variant, the longest transcript was chosen. Associated diseases and other relevant sources were identified by searching PubMed for the gene and amino acid change.	oncomap.tsv	054b9321-03e3-4e0e-9197-81e5f461036d-oncomap-variants-mayank	2016-05-17 21:35:47.419598	2016-05-17 21:35:47.419598	\N	Likely Pathogenic	http://www.sciencedirect.com/science/article/pii/S1525157814001287
\.
